import React, { Component } from 'react';
import { connect } from 'react-redux';
import { Form, Row, Col, Button } from 'react-bootstrap';
import Header, { HeaderLeft, HeaderCenter, HeaderRight } from '../../components/Dealer/Header';
import Footer from '../../components/Dealer/Footer';
import { IconFixIssueAwesomePaperPlane, IconFixIssueEnvelopeOpen, IconFixIssueAwesomePenFancy, IconFixIssueSend, IconFixIssueEnvelopeClosed, IconFixIssueAwesomePenFancyRight } from '../../assets/images';
import { getSalesList, getAppDetailById } from '../../redux/actions/sales';

class DealerIncomplete extends Component {

    state = {
    }

    componentDidMount() {
        // document.addEventListener("mousedown", this.handleClickOutside);
    }

    componentWillUnmount() {
        // document.removeEventListener("mousedown", this.handleClickOutside);
    }

    handleArrowBack = () => {
        this.props.history.goBack();
    }

    render() {

        return (
            <div className="fix-issue-section">
                <Header>
                    <HeaderLeft>
                        <img src={IconArrowLeft} onClick={this.handleArrowBack} height="28"/>
                    </HeaderLeft>
                    <HeaderCenter>
                        <span>FIX ISSUE</span>
                    </HeaderCenter>
                    <HeaderRight>
                    </HeaderRight>
                </Header>
                <div className="fix-issue-main">
                    <Row>
                        <Col xs={6}>
                            <Button variant="default"><img src={IconFixIssueAwesomePaperPlane} /></Button>
                            <Button variant="default"><img src={IconFixIssueEnvelopeOpen} /></Button>
                            <Button variant="default"><img src={IconFixIssueAwesomePenFancy} /></Button>
                        </Col>
                        <Col xs={6}>
                            <Button variant="default"><img src={IconFixIssueSend} /></Button>
                            <Button variant="default"><img src={IconFixIssueEnvelopeClosed} /></Button>
                            <Button variant="default"><img src={IconFixIssueAwesomePenFancyRight} /></Button>
                        </Col>
                    </Row>
                </div>            
            </div>
        )
    }
}


const mapStateToProps = state => ({
    apps: state.sales.apps
});

export default connect(
    mapStateToProps,
    {
        getSalesList,
        getAppDetailById
    }
)(DealerIncomplete);
